import React from 'react';
import home from "./img/home.jpg"

const Main = () => {
    return (
        <>
            <div className="container">
               <div className="row col-md-12">
                   <img src={home} alt="" />
               </div>

               .
            </div>
        </>
    )
}

export default Main;
